import React, { Fragment, useEffect, useState } from "react";

const ListCourses = () => {
  return (
    <Fragment>
      {" "}
      <table class="table table-sm">
        <thead>
          <tr>
            <th scope="col">Period 1</th>
            <th scope="col">First</th>
            <th scope="col">Last</th>
            <th scope="col">Handle</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
        </tbody>
      </table>
    </Fragment>
  );
};

export default ListCourses;
